import React,{useState,useEffect} from 'react';
import { SafeAreaView, View, Text, TouchableOpacity, FlatList ,Image,Button} from 'react-native';

export default function ReviewDetails({ navigation }) {
  return (
    <View>
      <Text>{ navigation.getParam('nombre') }</Text>
      <Text>{ navigation.getParam('descripcion') }</Text>
      <Text>{ navigation.getParam('precio') }</Text>
    </View>
  );
}
